import { View } from 'react-native';
import { MaterialCommunityIcons } from '@expo/vector-icons'; 


const Tabs = ({height}) =>{
    return(

        <View style={{height:height, width:"100%", backgroundColor:"red", position:"absolute", bottom:0}}>
            <View style={{height:"100%", width:"100%", display:'flex', alignItems:'center', justifyContent:'center', flexDirection:'row'}}>


                <View style={{height:"fit-content", justifyContent:'center', alignItems:'center', marginBottom:45, backgroundColor:"green"}}>
                    <MaterialCommunityIcons name="table-furniture" size={50} color="white" />
                </View>

            </View>

        </View>

        )
}

export default Tabs;
